import React from 'react'

const InfoPage = () => {
  return (
    <main className='info_page'>

        <h1 className='info_page_title'>О сайте</h1>
        <p>
            Данный сайт был сделан для Школьного конкурса "ПАТРИОТ.by"
        </p>

    </main>
  )
}

export default InfoPage
